  let isRules = false;
  let allLocations = Math.floor(allWords.length / 21);
  let lastLevel = 0;
  function fixDoneWords(allDoneWords) {
    let keys = Object.keys(allDoneWords);
    for(let i = 0; i < keys.length; i++){

      let k = keys[i];
      if(keys[i].indexOf('ё') !== -1){
        k = k.replace(/ё/g, 'е');
      }else if(k === "ассиметрия"){
        console.log('асс');
        k = "асимметрия";
      }
      let words = allDoneWords[keys[i]] || allDoneWords[k];

      if(words === 1){
        allDoneWords[k] = wordsFromWords[k];
        if(k === "асимметрия"){
          delete allDoneWords["ассиметрия"];
        }
      }else{
        if(keys[i].indexOf('ё')  !== -1){
          words = words.map((word)=>word.replace(/ё/g, 'е'));
        }

        delete allDoneWords[keys[i]];

        if(words.length > 0){
          let allWords = wordsFromWords[k];
          if(allWords){
            words = words.filter((word)=>allWords.includes(word));
            allDoneWords[k] = words;
          }

        }
      }


    }
    return allDoneWords;
  }
  if(allDoneWords){
    allDoneWords = fixDoneWords(JSON.parse(allDoneWords));
    tips = Number(tips);
    sounds = sounds === 'true';
    setLoc();
    isGameAdvShow = !isGameAdvShow;
  }else{
    allDoneWords = {};
    isGameAdvShow = false;
    isGameUpdate = false;
    tips = 3;
    isRules = true;
    sounds = true;
    localStorage.setItem('sounds', true);
    localStorage.setItem('allDoneWords', JSON.stringify(allDoneWords));
    localStorage.setItem('tips', 3);

    allWords.forEach((key => {
      allDoneWords[key] = [];
    }));
    for(let i = 0; i < allWords.length; i++){
      allStars.push(0);
    }
  }

  let recentState = JSON.stringify(PLAYESTATE);
  let recentStats = JSON.stringify(PLAYERSTATS);


  function setState() {
    const newData = JSON.stringify(PLAYESTATE);
    if(recentState === newData) return;
    recentState = newData;

    const newState = {
      allDoneWords: compressData(PLAYESTATE.allDoneWords)
    };
    if (playerGame) playerGame.setData(newState).then((ignored) => {
    }).catch(() => {
      playerGame.setData(newState).then((ignored) => {
      }).catch(() => {
            playerGame.setData(PLAYESTATE).then((ignored) => {
            }).catch(() => {
                  localStorage.setItem('offline', '1');
                });
          })
    });
  }
  function setStats() {
    const newData = JSON.stringify(PLAYERSTATS);
    if(recentStats === newData) return;
    recentStats = newData;
    if(playerGame) playerGame.setStats(PLAYERSTATS).then((ignored) => {}).catch(()=>{
      playerGame.setStats(PLAYERSTATS).then((ignored) => {})
    });
  }

  function saveAllData(){
    setState();
    setStats();
  }

  window.onblur = saveAllData;
  window.onunload= saveAllData;
  window.onbeforeunload = saveAllData;
  window.onpagehide = saveAllData;

  setInterval(()=>{
    saveAllData()
  }, 180000);



  function setLastLevel() {
    for(let i = allWords.length-1; i >= 0 ; i--){
      if(allDoneWords[allWords[i]].length > 0){
        console.log('last level, ', i);
        lastLevel = i;
        break;
      }
    }
  }

  function setLoc() {
    allWords.forEach((key => {
      if(allDoneWords[key]){
        allStars.push(testStar(allDoneWords[key].length, wordsFromWords[key].length))
      }else{
        allDoneWords[key] = [];
        allStars.push(0);
      }
    }));
    localStorage.setItem('allDoneWords', JSON.stringify(allDoneWords));
    setLastLevel();
    loc = Math.floor((lastLevel / 21));
    if(allStars.reduce((acc, st)=>{
      return acc + st;
    }, 0) < loc*32){
      loc--;
    }
    if(loc >= allLocations || loc < 0) loc = 0;
  }
