  .checkbox {
    position: absolute;
    z-index: -1;
    opacity: 0;
    margin: 10px 0 0 20px;
    user-select: none;
    -webkit-tap-highlight-color: rgba(0, 0, 0, 0);
  }
  .checkbox + label {
    position: relative;

    width: 100%;

    display: flex;
    align-items: center;
    font-size: 1.7rem;


    cursor: pointer;
    padding-right: 50px;
  }

  .checkbox + label:before {
    content: "";
    position: absolute;
    top: 50%;
    transform: translateY(-50%);
    right: 0;
    width: 45px;
    height: 20px;
    border-radius: 15px;
    background: #CDD1DA;
    box-shadow: inset 0 2px 3px rgba(0, 0, 0, 0.2);
    transition: 0.2s;
  }
  .checkbox + label:after {
    content: "";
    position: absolute;
    top: 50%;
    transform: translateY(-53%);
    right: 28px;
    width: 21px;
    height: 21px;
    border-radius: 50%;
    background: white;
    box-shadow: 0 2px 5px rgba(0, 0, 0, 0.3);
    transition: 0.2s;
  }
  .checkbox:checked + label:after {
    right: 0;
  }
  .checkbox:checked + label:before {
    background: #a95dbc;
  }

  .settings__text{
    font-size: 1.7rem;
    color: #955ea5;

    cursor: pointer;
  }


